/* eslint-disable react/prop-types */

// Soft UI Dashboard React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import MDAvatar from "components/MDAvatar";
import MDBadge from "components/MDBadge";

// Images
// import logoXD from "assets/images/small-logos/logo-xd.svg";
// import logoAtlassian from "assets/images/small-logos/logo-atlassian.svg";
// import logoSlack from "assets/images/small-logos/logo-slack.svg";
// import logoSpotify from "assets/images/small-logos/logo-spotify.svg";
// import logoJira from "assets/images/small-logos/logo-jira.svg";
// import logoInvesion from "assets/images/small-logos/logo-invision.svg";
import team2 from "assets/images/accident.png";
import team3 from "assets/images/battery.png";
import team4 from "assets/images/flattyre.png";
import team5 from "assets/images/fuelout.png";
import team6 from "assets/images/towing.png";
import { connect } from "react-redux";
import { useEffect, useState } from "react";
import * as actions from "../../../store/Actions/index";

function servicesData({ userAuthReducer, getAllServices }) {
  const [services, setServices] = useState();
  console.log("services", services);

  useEffect(() => {
    getAllServices(localStorage.getItem("token")).then(() => {
      const rowsData = userAuthReducer?.services?.map((ele) => {
        return {
          service: <Author image={team2} name={ele?.service_name} email="" />,
          status: (
            <MDBox ml={-1}>
              <MDBadge
                badgeContent="ACTIVE"
                color="success"
                variant="gradient"
                size="sm"
              />
            </MDBox>
          ),

          action: (
            <MDTypography
              variant="button"
              fontWeight="regular"
              display="block"
              color="info"
              fontWeight="medium"
              textGradient
            >
              Edit
            </MDTypography>
          ),
          activity: (
            <MDTypography
              variant="button"
              fontWeight="regular"
              display="block"
              color="info"
              fontWeight="medium"
              textGradient
            >
              DEACTIVATE NOW
            </MDTypography>
          ),
        };
      });
      setServices(rowsData);
    });
  }, []);

  const Author = ({ image, name, email }) => (
    <MDBox display="flex" alignItems="center" lineHeight={1}>
      <MDAvatar src={image} name={name} size="sm" />
      <MDBox ml={2} lineHeight={1}>
        <MDTypography display="block" variant="button" fontWeight="medium">
          {name}
        </MDTypography>
        <MDTypography variant="caption">{email}</MDTypography>
      </MDBox>
    </MDBox>
  );

  const Job = ({ title, description }) => (
    <MDBox lineHeight={1} textAlign="left">
      <MDTypography
        display="block"
        variant="caption"
        color="text"
        fontWeight="medium"
      >
        {title}
      </MDTypography>
      <MDTypography variant="caption">{description}</MDTypography>
    </MDBox>
  );

  return {
    columns: [
      { Header: "service", accessor: "service", width: "30%", align: "left" },
      { Header: "status", accessor: "status", align: "center" },
      { Header: "action", accessor: "action", align: "center" },
      { Header: "activity", accessor: "activity", align: "center" },
    ],

    rows: services,
  };
}

const mapStateToProps = ({ userAuthReducer }) => {
  return { userAuthReducer };
};

export default connect(mapStateToProps, actions)(servicesData);
